import React, { useState } from 'react';
import styled from 'styled-components';

// Styled Components
const PageContainer = styled.div`
  padding: 120px 5% 80px;
  min-height: 100vh;
`;

const PageTitle = styled.h1`
  font-size: 3.5rem;
  font-weight: 300;
  margin-bottom: 40px;
  color: ${props => props.theme.colors.secondary};
  position: relative;
  letter-spacing: -1px;
  
  &:after {
    content: '';
    position: absolute;
    bottom: -20px;
    left: 0;
    width: 60px;
    height: 1px;
    background-color: ${props => props.theme.colors.highlight};
  }
`;

const IntroText = styled.p`
  font-size: 1.3rem;
  line-height: 1.8;
  color: ${props => props.theme.colors.textSecondary};
  margin-bottom: 60px;
  max-width: 900px;
`;

const ModelsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 30px;
  margin-bottom: 60px;
  
  @media (max-width: ${props => props.theme.breakpoints.tablet}) {
    grid-template-columns: repeat(2, 1fr);
  }
  
  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const ModelCard = styled.div<{ selected: boolean }>`
  background-color: rgba(10, 10, 10, 0.8);
  backdrop-filter: blur(10px);
  position: relative;
  transition: all 0.4s ease;
  padding: 20px;
  border: 1px solid ${props => props.selected ? props.theme.colors.highlight : 'rgba(255, 255, 255, 0.1)'};
  box-shadow: ${props => props.selected ? '0 15px 30px rgba(155, 133, 121, 0.2)' : '0 10px 20px rgba(0, 0, 0, 0.2)'};
  cursor: pointer;
  
  &:hover {
    transform: translateY(-5px);
    border-color: ${props => props.theme.colors.highlight};
  }
`;

const ModelImage = styled.div`
  height: 180px;
  margin-bottom: 20px;
  overflow: hidden;
  
  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: transform 0.6s ease;
  }
  
  ${ModelCard}:hover img {
    transform: scale(1.05);
  }
`;

const ModelName = styled.h3`
  font-size: 1.4rem;
  font-weight: 300;
  margin-bottom: 10px;
  color: ${props => props.theme.colors.secondary};
  letter-spacing: 0.5px;
`;

const ModelCategory = styled.span`
  display: inline-block;
  font-size: 0.8rem;
  font-weight: 500;
  color: ${props => props.theme.colors.primary};
  background-color: ${props => props.theme.colors.highlight};
  padding: 4px 12px;
  margin-bottom: 15px;
  text-transform: uppercase;
  letter-spacing: 1px;
`;

const FormSection = styled.div`
  background-color: rgba(10, 10, 10, 0.5);
  padding: 40px;
  margin-bottom: 80px;
  border-left: 1px solid ${props => props.theme.colors.highlight};
`;

const FormTitle = styled.h2`
  font-size: 2rem;
  font-weight: 300;
  margin-bottom: 30px;
  color: ${props => props.theme.colors.secondary};
`;

const FormGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 30px;
  
  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const InputGroup = styled.div`
  margin-bottom: 25px;
`;

const Label = styled.label`
  display: block;
  font-size: 0.9rem;
  font-weight: 500;
  margin-bottom: 10px;
  color: ${props => props.theme.colors.textSecondary};
`;

const Input = styled.input`
  width: 100%;
  background-color: rgba(0, 0, 0, 0.3);
  border: 1px solid rgba(255, 255, 255, 0.1);
  padding: 15px;
  color: ${props => props.theme.colors.secondary};
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1rem;
  transition: border-color 0.3s ease;
  
  &:focus {
    outline: none;
    border-color: ${props => props.theme.colors.highlight};
  }
`;

const Select = styled.select`
  width: 100%;
  background-color: rgba(0, 0, 0, 0.3);
  border: 1px solid rgba(255, 255, 255, 0.1);
  padding: 15px;
  color: ${props => props.theme.colors.secondary};
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1rem;
  transition: border-color 0.3s ease;
  
  &:focus {
    outline: none;
    border-color: ${props => props.theme.colors.highlight};
  }
  
  option {
    background-color: ${props => props.theme.colors.primary};
  }
`;

const SubmitButton = styled.button`
  background-color: transparent;
  color: ${props => props.theme.colors.secondary};
  font-size: 0.9rem;
  font-weight: 400;
  padding: 15px 40px;
  border: 1px solid ${props => props.theme.colors.secondary};
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: all 0.4s ease;
  position: relative;
  overflow: hidden;
  z-index: 1;
  cursor: pointer;
  margin-top: 20px;
  
  &::after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 0;
    background-color: ${props => props.theme.colors.highlight};
    transition: height 0.4s cubic-bezier(0.19, 1, 0.22, 1);
    z-index: -1;
  }
  
  &:hover {
    color: ${props => props.theme.colors.primary};
    border-color: ${props => props.theme.colors.highlight};
    
    &::after {
      height: 100%;
    }
  }
`;

interface ModelType {
  id: string;
  name: string;
  category: string;
  image: string;
}

const TestDrivePage: React.FC = () => {
  const [selectedModel, setSelectedModel] = useState<string | null>(null);
  
  const models: ModelType[] = [
    { id: 'lbx', name: 'Lexus LBX', category: 'Compact', image: '/images/lexus_lbx.png' },
    { id: 'ux', name: 'Lexus UX', category: 'Compact SUV', image: '/images/lexus_ux.png' },
    { id: 'rz', name: 'Lexus RZ', category: 'Electric', image: '/images/lexus_rz.png' },
    { id: 'nx', name: 'Lexus NX', category: 'SUV', image: '/images/lexus_nx.png' },
    { id: 'rx', name: 'Lexus RX', category: 'Premium SUV', image: '/images/lexus_rx.png' },
    { id: 'es', name: 'Lexus ES', category: 'Sedan', image: '/images/lexus_es.png' },
    { id: 'ls', name: 'Lexus LS', category: 'Luxury Sedan', image: '/images/lexus_ls.png' },
  ];
  
  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    alert('Your test drive request has been submitted. A Lexus representative will contact you shortly to confirm your appointment.');
  };
  
  return (
    <PageContainer>
      <PageTitle>Schedule a Test Drive</PageTitle>
      
      <IntroText>
        Experience the exceptional performance, craftsmanship, and innovation of Lexus firsthand. Select a model below and complete the form to schedule your personalized test drive.
      </IntroText>
      
      <ModelsGrid>
        {models.map(model => (
          <ModelCard 
            key={model.id} 
            selected={selectedModel === model.id}
            onClick={() => setSelectedModel(model.id)}
          >
            <ModelImage>
              <img src={model.image} alt={model.name} />
            </ModelImage>
            <ModelCategory>{model.category}</ModelCategory>
            <ModelName>{model.name}</ModelName>
          </ModelCard>
        ))}
      </ModelsGrid>
      
      <FormSection>
        <FormTitle>Your Information</FormTitle>
        <form onSubmit={handleSubmit}>
          <FormGrid>
            <div>
              <InputGroup>
                <Label htmlFor="firstName">First Name</Label>
                <Input type="text" id="firstName" required />
              </InputGroup>
              
              <InputGroup>
                <Label htmlFor="email">Email Address</Label>
                <Input type="email" id="email" required />
              </InputGroup>
              
              <InputGroup>
                <Label htmlFor="date">Preferred Date</Label>
                <Input type="date" id="date" required />
              </InputGroup>
            </div>
            
            <div>
              <InputGroup>
                <Label htmlFor="lastName">Last Name</Label>
                <Input type="text" id="lastName" required />
              </InputGroup>
              
              <InputGroup>
                <Label htmlFor="phone">Phone Number</Label>
                <Input type="tel" id="phone" required />
              </InputGroup>
              
              <InputGroup>
                <Label htmlFor="time">Preferred Time</Label>
                <Select id="time" required>
                  <option value="">Select a time</option>
                  <option value="morning">Morning (9:00 - 12:00)</option>
                  <option value="afternoon">Afternoon (12:00 - 16:00)</option>
                  <option value="evening">Evening (16:00 - 19:00)</option>
                </Select>
              </InputGroup>
            </div>
          </FormGrid>
          
          <InputGroup>
            <Label htmlFor="comments">Additional Comments</Label>
            <Input as="textarea" id="comments" rows={4} />
          </InputGroup>
          
          <SubmitButton type="submit" disabled={!selectedModel}>
            Submit Request
          </SubmitButton>
        </form>
      </FormSection>
    </PageContainer>
  );
};

export default TestDrivePage;
